import "./App.css";

import { useState } from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  Redirect,
} from "react-router-dom";
import jwt_decode from "jwt-decode";

import backDropVideo from "./components/video/backDropVideo.mp4";
import NavBar from "./components/hiddencomponents/NavBar";
import Home from "./components/homecomponents/Home";
import Information from "./components/homecomponents/Information";
import Login from "./components/homecomponents/Login";
import Register from "./components/homecomponents/Register";
import PlayGame from "./components/homecomponents/PlayGame";

function App() {
  return (
    <Router>
      <div className="App">
        <NavBar />

        <Switch>
          <Route exact path="/">
            <Home />
          </Route>

          <Route path="/playgame">
            <PlayGame />
          </Route>

          <Route path="/information">
            <Information />
          </Route>

          <Route path="/settings">
            <Settings />
          </Route>

          <Route pathname="/login">
            <Login />
          </Route>

          <Route pathname="/register">
            <Register />
          </Route>



        </Switch>

        <video id="background" autoPlay loop muted>
          <source src={backDropVideo} type="video/mp4" />
        </video>
      </div>
    </Router>
  );
}

export default App;
